    false,nt"url": null,nt"notes": "The American Community Survey (ACS) is
    an ongoing statistical survey that samples a small percentage of the population
    every year. These data have been apportioned to 13 coastal geographies, and contain
    detailed demographic, social, economic, and housing characteristics. They represent
    5-year estimates derived from the ACS Block Group summary files. Detailed information
    on the ACS data can be found at the Census Bureau's American Community Survey website
    and in their researcher's guide entitled, "A Compass for Understanding and Using
    American Community Survey Data". Detailed information on the geographies the data
    are available for can be found here: http://www.coast.noaa.gov/htdata/SocioEconomic/AmericanCommunitySurvey/AmericanCommunitySurvey_DataDescription.pdf",nt"license_title":
